import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import image from "./images/4e6029bd-9cd4-4325-9eec-0b356f558a1e.jpg";
ReactDOM.render(
  <App>
    <img src={image} alt='no image is found ' />
  </App>,
  document.getElementById("root")
);
